import React from "react";
import { View, Text } from "react-native";
import IconAD from 'react-native-vector-icons/Feather';
import tw from "twrnc";

export default function MessagesHeader() {
  return (
    <View>
      <View
        style={tw`px-[13px] py-[5px] flex-row items-center justify-between`}
      >
        <View
          style={tw`bg-[#e6e6e6] px-[16px] py-[8px] w-[85%] rounded-[10px] flex-row items-center`}
        >
          <IconAD
            name="search"
            size={18}
            style={tw`mr-[13px] text-[#6E6E6E]`}
          />
          <Text style={tw`text-[14px] text-[#6E6E6E]`}>Search</Text>
        </View>
        <Text style={tw`text-[#0092fc] font-bold text-[12px]`}> Filter</Text>
      </View>

      {/* Tabs Header  */}
      <View
        style={tw`mt-[15px] px-[13px] py-[5px] flex-row items-center justify-between`}
      >
        <View
          style={tw`w-[32%] h-[36px] items-center justify-center bg-[#129cff40] rounded-[10px]`}
        >
          <Text style={tw`text-[#0092fc] text-[11px] font-bold`}>Primary</Text>
        </View>
        <View
          style={tw`w-[32%] h-[36px] items-center justify-center bg-[#e6e6e6] rounded-[10px]`}
        >
          <Text style={tw`text-[#282525] text-[11px] font-bold`}>General</Text>
        </View>
        <View
          style={tw`w-[32%] h-[36px] items-center justify-center bg-[#e6e6e6] rounded-[10px]`}
        >
          <Text style={tw`text-[#282525] text-[11px] font-bold`}>Requests</Text>
        </View>
      </View>
    </View>
  );
}
